import { styled } from "styled-components";

const LogoDiv = styled.div`
  margin-right: 100px;
`;

const SBLogo = () => {
  return (
    <LogoDiv>
      <img src="data:image/svg+xml;base64,"></img>
    </LogoDiv>
  );
};

export default SBLogo;
